// src/TradingText.js
import React from "react";
import Typed from "react-typed";

const TradingText = () => {
  return (
    <div>
      <h1 className="text-white homepagetextshadow">
        Trading{" "}
        <Typed
          strings={["Bitcoin", "Gold", "Tesla", "Oil", "ETH", "USD"]}
          typeSpeed={40}
          backSpeed={50}
          loop
        />
        <br />
        just got a whole lot easier
      </h1>
    </div>
  );
};

export default TradingText;
